import LatestNews from "./LatestNews";
import About from "./About";
import RecentEvents from "./RecentEvents";
import RegisterLogin from './RegisterLogin';
import "./Main.css"

function Main({page, selectPage, currentUser, loggedin}) {
    return (
        <main className="main">
            {page === "/latest_news.html" && <LatestNews/>}
            {page === "/recent_events.html" && <RecentEvents selectPage={selectPage}/>}
            {page === "/animal_database.html" && <About/>}
            {page === "/register_login.html" && <RegisterLogin currentUser={currentUser} loggedin={loggedin}/>}
        </main>
    );
}
export default Main;
